import React from "react";

import "./preloader.css";

function Preloader() {
  return (
    <div>
%p.link
  Based on
  %a(href = 'http://drbl.in/mPeZ')this dribbble shot
  by
  %a(href='https://dribbble.com/acolli')Alex Collins

- @n = 3
.container
  - @n.times do
    %i.layer
    </div>
  );
}

export default Preloader;
